import { useNavigate, useParams, useState } from "react-router-dom";
import {
    Alert,
    Button,
    ImageBackground,
    StyleSheet,
    Modal,
    Text,
    Pressable,
    View,
    SafeAreaView,
    TextInput
} from 'react-native';
import Icon from 'react-native-vector-icons/FontAwesome';

const Navbar = () => {
    const navigate = useNavigate();

    return (
        <SafeAreaView>
            <Text style={styles.buttonOpen}>
            <Pressable>
                <Icon.Button
                    // name="head" 
                    style={styles.buttonOpen}
                    onPress={() => navigate("/Patient_id")}
                >
                   Patient Profile
                </Icon.Button>
            </Pressable>
            <Pressable>
                <Icon.Button
                    // name="plus"
                    style={styles.buttonOpen}
                    onPress={() => navigate("/Patient_id/Triage")}
                >
                    Triage
                </Icon.Button>
            </Pressable>
            <Pressable>
                <Icon.Button
                    // name="plus"
                    style={styles.buttonOpen}
                    onPress={() => navigate("/Patient_id/GCS")}
                >
                    GCS
                </Icon.Button>
            </Pressable>
            <Pressable>
                <Icon.Button
                    // name="plus"
                    style={styles.buttonOpen}
                    onPress={() => navigate("/Patient_id/CRS")}
                >
                    CRS
                </Icon.Button>
            </Pressable>
            <Pressable>
                <Icon.Button
                    // name="plus"
                    style={styles.buttonOpen}
                    onPress={() => navigate("/Patient_id/PSofa")}
                >
                    PSofa
                </Icon.Button>
            </Pressable>
            <Pressable>
                <Icon.Button
                    // name="plus"
                    style={styles.buttonOpen}
                    onPress={() => navigate("/Patient_id/Prism")}
                >
                    Prism
                </Icon.Button>
            </Pressable>
            <Pressable>
                <Icon.Button
                    // name="plus"
                    style={styles.buttonOpen}
                    onPress={() => navigate("/Patient_id/OI")}
                >
                    Oxygenation Index
                </Icon.Button>
            </Pressable>
            <Pressable>
                <Icon.Button
                    // name="plus"
                    style={styles.buttonOpen}
                    onPress={() => navigate("/Patient_id/Api")}
                >
                    API
                </Icon.Button>
            </Pressable>
            <Pressable>
                <Icon.Button
                    // name="plus"
                    style={styles.buttonOpen}
                    onPress={() => navigate("/Patient_id/Analysis")}
                >
                    Analysis
                </Icon.Button>
            </Pressable>
            <Pressable>
                <Icon.Button
                    // name="plus"
                    style={styles.buttonOpen}
                    onPress={() => navigate("/User_id")}
                >
                    Your Profile
                </Icon.Button>
            </Pressable>
            </Text>
        </SafeAreaView>
    );
};
const styles = StyleSheet.create({
    buttonOpen: {
        backgroundColor: "#56BF9C",
    },
    // button:{
    //     backgroundColor: "#569ebf"
    // }
});

export default Navbar;
